#NEWADMUFW2493

 at this point what if hindi na magturo ng onsite/synchronously mga ibang profs diyan. just give us all 1.5 hours per session to just read the damn readings and do the modules because asking us to read around 30-60 pages EACH subject outside of class hours is absolutely fucking insane. reading is one thing, comprehension is another, and studying/memorizing/making connections just makes more of our time stretched thin. im basically doing acads every waking hour. im not supposed to. im fucking exhausted. 

 // rant only. ill still do my responsibilities as a student no matter how unfair and soul-draining it is. need lang lumabas ng frustration

